import React, { Component } from 'react'

class MassageAdmin extends Component {

    constructor() {
        super()
        this.state = {
            massageData: []
        }
    }

    render() {
        return (
            <div>
                <table>
                    {this.state.massageData.map(a => (
                        <tr>
                            <td></td>
                        </tr>
                    ))}
                </table>
            </div>)
    }
}
export default MassageAdmin
